import React from "react";

class Map extends React.Component {
  initMap = () => {
    map = new google.maps.Map(document.getElementById("map"), {
      center: { lat: -34.397, lng: 150.644 },
      zoom: 8
    });
  };

  render() {
    return (
      <main>
        <div style={{ height: "100%" }} id="map" />
      </main>
    );
  }
}

export default Map;
